import React from 'react';
import {
    Container
} from '@mui/material';
import bghero from './hero.jpg'

const heroStyle = {
    border: 'solid 2px black',
    height: '90vh',
    width: '100vw',
    backgroundImage:`url(${bghero})`
}

const Hero = () => {
    return (
        <Container
            sx={heroStyle}
            maxWidth={false}
        >

        </Container>
    )
}

export default Hero;
